const styles = {

    buttonText: {
        flex: 1,
        justifyContent: 'center',
        textAlign: 'center',
        color: '#FFF',
        fontFamily: 'Roboto_500Medium',
        fontSize: 16,
    },
    
    description: {
        height: 180,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 80,
        paddingHorizontal: 10,
        paddingVertical: 10,
        fontSize: 16,
    },

    image: {
        width: 200,
        height: 200,
        alignItems: 'center',
        borderRadius: 100,
        marginTop: 50
    },

    main: {
        flex: 1,
        alignItems: 'center'
    },

    main2: {
        flex: 1,
        alignItems: 'center'
    },

    title: {
        fontFamily: 'Ubuntu_700Bold',
        color: '#322153',
        fontSize: 17,
        marginTop: 115,
        textAlign: 'center'
    },
}

export default styles;
